import Banner_a_propos from "../../components/Banner_a_propos/Banner_a_propos.js";
import Collapse from "../../components/Collapse/Collapse.js";
import Tag from "../../components/Tag/Tag.js";
import Logements from "../../Logements.js";

// const textes = [
