function Apropos() {
  return (
    <>
      <Banner_a_propos img_banner_a_propos="assets/photo_banner_a_propos.png" />
      <div className="kasa-group-tag">
        {Logements.map((data, index) => (
          <Tag key={index} titre_tag={data.tags} /> // Boucle sur le nombre de logement présent dans le fichier logements.js
        ))}
      </div>
      <Collapse
        type_collapse="texte"
        description_collapse="description"
        titre_collapse="Fiabilité"
      />
      <Collapse
        type_collapse="liste"
        description_collapse="description"
        titre_collapse="Respect"
      />
      <Collapse
        type_collapse="texte"
        description_collapse="description"
        titre_collapse="Service"
      />
      <Collapse
        type_collapse="texte"
        description_collapse="description"
        titre_collapse="Sécurité"
      />
    </>
  );
}

export default Apropos;
